description:
I Love You Too is a 2010 Australian romantic comedy film,and the directorial film debut of Daina Reid. The screenplay was written by first-time writer Peter Helliar. It stars Brendan Cowell, Peter Dinklage, Yvonne Strahovski, Peter Helliar and Megan Gale

